import UpdatePrice from '../buttons/UpdatePropBtn.js';
import UpdatePropBtn from '../buttons/UpdatePriceBtn.js';
import UpdateExpire from '../buttons/UpdateExpireBtn.js';


const UpdateForm =  ({ drizzle, drizzleState, assetPrice, listPrice, propAddress, orderId, prevOrderStatus, expiresAt, currentExpiresAt }) => { 
return (
    <UpdatePropBtn drizzle={drizzle} drizzleState={drizzleState} assetPrice={assetPrice} listPrice={listPrice} propAddress={propAddress} orderId={orderId} prevOrderStatus={prevOrderStatus} expiresAt={expiresAt} currentExpiresAt={currentExpiresAt} />
  )
}
  

  
  
  
  export default UpdateForm;
